import React from "react";
import Collapsable from "./Collapsable";

function Form() {
  return (
    <form className="form js-form form__wrapper" action="" method="POST">
      {/* <div className="form__wrapper"> */}
      <Collapsable />
      {/*  </div> */}
    </form>
  );
}

export default Form;
